import React from 'react';
import { Grid, Divider, Segment } from 'semantic-ui-react';
import { Link } from 'react-router-dom';

const Homepage = () => {
	return (
		<div>
			<h1>Four Walls of Iron</h1>
			<Segment>
				<Grid columns={2}>	
					<Grid.Column>
						<Link to="/maxes">
							{'Strength'}
						</Link>
					</Grid.Column>
					<Grid.Column>
						<Link to="/maxes">
							{'Bodybuilding'}
						</Link>
					</Grid.Column>
				</Grid>
				<Divider vertical>Or</Divider>
			</Segment>
		</div>
	)
}

export default Homepage;
